// import { PageContainer, Title } from "./styles/roadmap_style.js";

// function Roadmap() {
//   return (
//     <PageContainer>
//       <Title>Roadmap</Title>
//     </PageContainer>
//   );
// }

// export default Roadmap;

import React, { useEffect, useRef, useState } from "react";
import { PageContainer, Title } from "./styles/roadmap_style.js";
import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";

function Roadmap() {
  // <PageContainer>
  //   <Title>Roadmap</Title>
  <VerticalTimeline>
    <VerticalTimelineElement
      className="vertical-timeline-element--work"
      contentStyle={{ background: "rgb(33, 150, 243)", color: "#fff" }}
      contentArrowStyle={{ borderRight: "7px solid  rgb(33, 150, 243)" }}
      date="2023 - Q2"
    >
      <h3 className="vertical-timeline-element-subtitle">
        Launch Live Map MVP
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Launch Trends Map MVP
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Complete pre-seed funding round
      </h3>
    </VerticalTimelineElement>
    <VerticalTimelineElement
      className="vertical-timeline-element--work"
      date="2023 - Q3"
    >
      <h3 className="vertical-timeline-element-subtitle">
        Hire engineering staff
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Integrate real-time VDR data into Live Map
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Upgrade AIS and Weather data
      </h3>
    </VerticalTimelineElement>
    <VerticalTimelineElement
      className="vertical-timeline-element--work"
      date="2023 - Q4"
    >
      <h3 className="vertical-timeline-element-subtitle">
        Launch Route Analytics platform
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Integrate historical VDR data into Trends Map
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Deliver global Live Map coverage
      </h3>
    </VerticalTimelineElement>
    <VerticalTimelineElement
      className="vertical-timeline-element--work"
      date="2024 - Q1 and Beyond"
    >
      <h3 className="vertical-timeline-element-subtitle">Launch API suite</h3>
      <h3 className="vertical-timeline-element-subtitle">
        Launch Route Optimization platform
      </h3>
      <h3 className="vertical-timeline-element-subtitle">
        Launch Data Marketplace
      </h3>
    </VerticalTimelineElement>
    ;
  </VerticalTimeline>;
  // </PageContainer>;
}

export default Roadmap;
